import React from 'react'
import '../styles/App.css'

const TableHead = ({tableHeader}) => {

  return (
    <div className="header">
      <div className="cell">
        <strong>
          {tableHeader.date}
        </strong>
        <div className="cell">
        <strong>
          {tableHeader.name}
        </strong>
        </div>
      </div>
    </div>
  );
}

export default TableHead
